import "./style.css";
import Post from './records.json';


export default function DataFetching() {
    return (
    <div className="post">
        <ul>

            {Post.map(post => (
                <li key={post.id}>
                    <h3>{post.title}</h3>
                    <p>{post.content}</p>
                </li>
            ))}

        </ul>

    </div>
    )
}
